description:
SG-1 vindt in de Tok'ra, een vriendelijke afsplitsing van de goa'uld, en de Asgard, een technologisch zeer geavanceerd ras, bondgenoten voor hun strijd tegen de Goa'uld.

5.Need - 24 juli 1998 - Daniel Jackson raakt verslaafd aan het gebruik van een sarcofaag.

6.Thor's Chariot - 31 juli 1998 - De planeet uit Thor's Hammer wordt aangevallen door de goa'uld Heru-ur. SG-1 gaat de bewoners helpen omdat zij de hamer hebben vernietigd.

7.Message in a Bottle - 7 augustus 1998 - SG-1 neemt een bol mee van een andere planeet. De bol neemt echter het SGC over.

8.Family - 14 augustus 1998 - SG-1 gaat de zoon van Teal'c bevrijden uit de handen van Apophis.

